    false,nt"url": null,nt"notes": "This data set shows the monitoring locations
    of trained Volunteer Water Quality Monitors. A monitoring site is considered to
    be a 300 foot section of stream channel. If possible, a riffle should be present
    within the site. There are four levels of training for the Volunteer Water Quality
    Monitoring program, Introductory, Level 1, Level 2, and Level 3. Introductory level
    monitors collect data on macroinvertebrates, stream discharge, and temperature.
    Level 1 monitors do all the previous monitoring and also monitor for dissolved oxygen,
    turbidity, nitrates, pH, and conductivity. Level 2 monitors complete additional
    quality assurance/quality control training to improve chemical and macroinvertebrate
    monitoring techniques. Depending on conditions, they may also monitor for one or
    more of the following: phosphates, ammonia, hardness, alkalinity and chloride. Level
    3 monitors undergo stringent quality control assessment to ensure the most accurate
    data possible with the equipment provided.",nt"license_title": null,nt"extras":
